  [],\n\t\"num_tags\": 0,\n\t\"name\": \"crossover-difference-data-records-xdr-from-geosat-geodetic-mission-gm-and-exact-repeat-mission-04f35\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Crossover difference data records (XDRs)
  from the GEOSAT Geodetic Mission (GM) and Exact Repeat Mission (ERM) for the time
  period of March 31, 1985 to November 7, 1987. Parameters include: time, orbit, latitude/longitude,
  and sea surface height. Corrections to the data include: sea level, wind and wave
  data, tides, dry and wet troposphere, ionosphere, height bias, altimeter crossover
  differences, altimeter sea surface measurement, and spacecraft orientation. These
  data were submitted by the U.S. Navy via National Ocean Service.nnThe US Navy Geosat
  (Geodetic Satellite) radar altimeter mission lasted for nearly 5 years (March 1985
  to January 1990) and collected approximately 750 million measurements of sea level,
  wave height, and wind speed over the global oceans. During the Geodetic Mission
  (1986 to 1987), the satellite did not repeat its ground track for the duration of
  the mission. The orbit of the satellite was changed in early October 1986 to begin
  the Exact Repeat Mission (ERM) which lasted from November 1986 until the satellite
  quit functioning in January 1990. During the ERM, the satellite repeated its ground
  track every 17 days. Data were initially processed by the Johns Hopkins University
  Applied Physics Laboratory in Laurel, MD in coordination with the NOAA/NOS Satellite
  Altimeter Group. Data products were transferred to the NOAA National Oceanographic
  Data Center (NODC) for distribution. Data products are archived at the NODC.\",\n\t\"owner_org\":
